import { USER_PROFILE_INFO_MUTATION } from '../api/user'

const Profile = () => {
    const user = localStorage.getItem('user')
    const [ profileInfo, { profileData } ] = useMutation(USER_PROFILE_INFO_MUTATION)

    useEffect(() => {
        console.log(user)
        profileInfo({ variables: { user: user } })
    }, [user])

